-- Apply overrides from optional DF95_PluginMetaOverrides.lua
function M.apply_overrides()
  local ok, reaper_obj = pcall(function() return reaper end)
  if not ok or not reaper_obj then return end
  local res_path = reaper_obj.GetResourcePath()
  local overrides_path = res_path .. "/Scripts/IFLS/DF95/DF95_PluginMetaOverrides.lua"
  local ok2, overrides_chunk = pcall(dofile, overrides_path)
  if not ok2 or type(overrides_chunk) ~= "table" then return end
  local overrides = overrides_chunk.OVERRIDES or overrides_chunk.overrides or overrides_chunk
  if type(overrides) ~= "table" then return end

  for fx_name, ov in pairs(overrides) do
    local meta = PLUGIN_META[fx_name]
    if meta and type(ov) == "table" then
      if ov.category and type(ov.category) == "string" then
        meta.category = ov.category
      end
      if ov.idm_group and type(ov.idm_group) == "string" then
        meta.idm_group = ov.idm_group
      end
    end
  end
end

function M.get_all()
  return PLUGIN_META
end

function M.iter()
  local t = PLUGIN_META
  local keys = {}
  for k in pairs(t) do keys[#keys+1] = k end
  table.sort(keys)
  local i = 0
  return function()
    i = i + 1
    local k = keys[i]
    if not k then return nil end
    return k, t[k]
  end
end

function M.filter_by_group(group)
  local out = {}
  group = tostring(group or ""):lower()
  for name, meta in M.iter() do
    if tostring(meta.idm_group or ""):lower() == group then
      out[#out+1] = meta
    end
  end
  return out
end

function M.filter_by_category(cat)
  local out = {}
  cat = tostring(cat or ""):lower()
  for name, meta in M.iter() do
    if tostring(meta.category or ""):lower() == cat then
      out[#out+1] = meta
    end
  end
  return out
end

return M

